import React from 'react';
import logo from './logo.svg';
import './App.css';
import Card from './components/Card'

function App() {
  return (
    <div className="App">
      <h1>Redux Example</h1>
      <div className='line'>
        <Card title='Card 1' red>x</Card>
        <Card title='Card 2' green>x</Card>
      </div>
      <div className='line'>
        <Card title='Card 3' blue>y</Card>
        <Card title='Card 4' purple>y</Card>
      </div>
    </div>
  );
}

export default App;
